import { Button, IconButton, Toolbar, Box, AppBar, InputBase, Grid } from "@mui/material";
import Divider from '@mui/material/Divider';
import SearchIcon from '@mui/icons-material/Search';
import NotificationsIcon from '@mui/icons-material/Notifications';
import MessageIcon from '@mui/icons-material/Message';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import Logo from "../images/logo.png"
import styled from "@mui/material/styles/styled";
import { useTheme } from "@mui/system";
import { useNavigate } from "react-router-dom";

function TopBar(){

    const StyledInputBase = styled(InputBase)(({ theme }) => ({
        color: 'inherit', 
        width: 'calc(100% - 48px)',
        flex:'1',
        '& .MuiInputBase-input': {
            transition: theme.transitions.create('width'),
            [theme.breakpoints.up('sm')]: {
            width: '20ch',
            '&:focus': {
                width: '40ch',
            },
            },
        },
    }));

    const theme = useTheme()
    const navigate = useNavigate()

    return(
        <AppBar className="topbar-appbar">
            <div className="topbar-toolbar">
                <div className="topbar-logo-container">
                    <img className="topbar-logo" alt="logo" src={Logo}/>
                </div>
                <div className="topbar-items-container">
                    <div className="topbar-search-container">
                        <StyledInputBase
                        placeholder="Cerca..."
                        inputProps={{ 'aria-label': 'search' }}
                        />
                        <IconButton
                        type="button"
                        sx={{ p: "10px", width: "48px" }}
                        aria-label="search"
                        >
                            <SearchIcon style={{color: theme.palette.background.paper}}/>
                        </IconButton>
                    </div>
                    <div className="topbar-items">
                        <Grid container columnSpacing={1}>
                            <Grid item xs={4}>
                                <Button variant="contained" sx={{ fontSize: '16px' }} style={{  color: 'white'}}>DISCOVER</Button>
                            </Grid>
                            <Grid item xs={4}>
                                <Button variant="contained" sx={{ fontSize: '16px' }} style={{  color: 'white'}}>DISCOVER</Button>
                            </Grid>
                            <Grid item xs={4}>
                                <Button variant="contained" sx={{ fontSize: '16px' }} style={{  color: 'white'}}>DISCOVER</Button>
                            </Grid>
                        </Grid>
                    </div>
                </div>
            </div>
        </AppBar>
    )

}

export default TopBar;
